import React, { useState } from 'react';

export default function Profile() {
  const [formData, setFormData] = useState({
    name: '',
    age: '',
    college: '',
    photo: null,
  });

  const [submittedData, setSubmittedData] = useState(null);

  // Handle form input change
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  // Handle file upload
  const handleFileChange = (e) => {
    const file = e.target.files[0];
    setFormData((prevData) => ({
      ...prevData,
      photo: file,
    }));
  };

  // Simulate API call
  const handleSubmit = async (e) => {
    e.preventDefault();

    // Mock API endpoint and request
    const mockApiEndpoint = 'https://jsonplaceholder.typicode.com/posts';
    
    const formDataToSend = new FormData();
    formDataToSend.append('name', formData.name);
    formDataToSend.append('age', formData.age);
    formDataToSend.append('college', formData.college);
    formDataToSend.append('photo', formData.photo); // Append the photo

    try {
      const response = await fetch(mockApiEndpoint, {
        method: 'POST',
        body: formDataToSend,
      });

      const result = await response.json();
      setSubmittedData(result); // Store the response from the mock API
      alert('Data submitted successfully');
    } catch (error) {
      console.error('Error submitting the form:', error);
      alert('Error submitting the form');
    }
  };

  return (
    <div className="p-4">
      <h2 className="text-3xl font-semibold">Profile Page</h2>
      <p className="mt-4">This is the profile page.</p>

      <form onSubmit={handleSubmit} className="mt-8 space-y-4">
        <div>
          <label className="block text-lg font-medium">Name:</label>
          <input
            type="text"
            name="name"
            value={formData.name}
            onChange={handleChange}
            className="mt-1 p-2 border rounded w-full"
            required
          />
        </div>

        <div>
          <label className="block text-lg font-medium">Age:</label>
          <input
            type="number"
            name="age"
            value={formData.age}
            onChange={handleChange}
            className="mt-1 p-2 border rounded w-full"
            required
          />
        </div>

        <div>
          <label className="block text-lg font-medium">College Name:</label>
          <input
            type="text"
            name="college"
            value={formData.college}
            onChange={handleChange}
            className="mt-1 p-2 border rounded w-full"
            required
          />
        </div>

        <div>
          <label className="block text-lg font-medium">Photo:</label>
          <input
            type="file"
            name="photo"
            onChange={handleFileChange}
            className="mt-1 p-2 border rounded w-full"
            accept="image/*"
            required
          />
        </div>

        <button
          type="submit"
          className="mt-4 bg-blue-500 text-white p-2 rounded"
        >
          Submit
        </button>
      </form>

      {submittedData && (
        <div className="mt-8 p-4 border-t border-gray-300">
          <h3 className="text-2xl font-medium">Submitted Data</h3>
          <p><strong>Name:</strong> {submittedData.name}</p>
          <p><strong>Age:</strong> {submittedData.age}</p>
          <p><strong>College:</strong> {submittedData.college}</p>
        </div>
      )}
    </div>
  );
}
